		this->redraw = 0;
		Display_UnrenderCursor(this->oldButton->getX() - borderWidth, this->oldButton->getY() - borderWidth, oldButton->sprite->width + 2*borderWidth, oldButton->sprite->length + 2*borderWidth, currentScene->backgroundBMP);
